import React from 'react';

const Footer = () => {
    const thisYear = () => {
        const year = new Date().getFullYear();
        return year
    };

    return (
        <div id='footer' className='text-center p-2'>
            <p>
                HoleInOne
            </p>
            <p>
                Copyright &copy; <span>{thisYear()}</span>
            </p>
        </div>
    )
};

export default Footer;
